import React from "react";
import styled from "styled-components";

function Projects(props) {
  return (
    <PortfolioWrapper>
      <h2>Projects</h2>
      <hr />
      <Project>
        <h3>Training Bot</h3>
      </Project>
    </PortfolioWrapper>
  );
}

export default Projects;

const PortfolioWrapper = styled.div`
  width: 100vw;
  padding: 0 55px;
  min-height: 100vh;
  margin-top: 60px;
  h2 {
    font-size: 45px;
    margin: 0;
  }
`;

const Project = styled.div`
  width: 98%;
  height: 400px;
  margin: 25px auto;
  background: rgba(0, 0, 0, 0.09);
`;
